import React from 'react';
import styled from '@emotion/styled';
import { motion } from 'framer-motion';
import { FaRobot, FaCode, FaMobile, FaCloud } from 'react-icons/fa';
import './App.css';

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const Header = styled.header`
  padding: 20px 0;
  position: fixed;
  width: 100%;
  top: 0;
  background: rgba(255, 255, 255, 0.95);
  backdrop-filter: blur(5px);
  z-index: 1000;
`;

const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const Logo = styled.h1`
  font-size: 1.5rem;
  color: #2d3436;
  margin: 0;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 2rem;

  @media (max-width: 768px) {
    display: none;
  }
`;

const NavLink = styled.a`
  color: #2d3436;
  text-decoration: none;
  font-weight: 500;
  transition: color 0.3s ease;

  &:hover {
    color: #0984e3;
  }
`;

const Hero = styled.section`
  min-height: 100vh;
  display: flex;
  align-items: center;
  padding: 100px 0;
  background: linear-gradient(135deg, #74b9ff 0%, #0984e3 100%);
  color: white;
`;

const HeroContent = styled.div`
  max-width: 600px;
`;

const Title = styled(motion.h1)`
  font-size: 3.5rem;
  margin-bottom: 1rem;

  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
`;

const Subtitle = styled(motion.p)`
  font-size: 1.25rem;
  margin-bottom: 2rem;
  opacity: 0.9;
`;

const Button = styled(motion.a)`
  display: inline-block;
  padding: 1rem 2rem;
  background: white;
  color: #0984e3;
  text-decoration: none;
  border-radius: 5px;
  font-weight: 600;
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-2px);
  }
`;

const Services = styled.section`
  padding: 100px 0;
  background: #f5f6fa;
`;

const SectionTitle = styled.h2`
  text-align: center;
  font-size: 2.5rem;
  margin-bottom: 3rem;
  color: #2d3436;
`;

const ServiceGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  padding: 0 20px;
`;

const ServiceCard = styled(motion.div)`
  background: white;
  padding: 2rem;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  text-align: center;
`;

const ServiceIcon = styled.div`
  font-size: 2.5rem;
  color: #0984e3;
  margin-bottom: 1rem;
`;

const ServiceTitle = styled.h3`
  font-size: 1.5rem;
  margin-bottom: 1rem;
  color: #2d3436;
`;

const ServiceDescription = styled.p`
  color: #636e72;
  line-height: 1.6;
`;

function App() {
  return (
    <div className="App">
      <Header>
        <Nav>
          <Logo>Seagull Technologies</Logo>
          <NavLinks>
            <NavLink href="#services">Services</NavLink>
            <NavLink href="#about">About</NavLink>
            <NavLink href="#contact">Contact</NavLink>
          </NavLinks>
        </Nav>
      </Header>

      <Hero>
        <Container>
          <HeroContent>
            <Title
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
            >
              Building the Future with AI
            </Title>
            <Subtitle
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
            >
              We specialize in developing cutting-edge AI applications that transform businesses and enhance user experiences.
            </Subtitle>
            <Button
              href="#contact"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Get Started
            </Button>
          </HeroContent>
        </Container>
      </Hero>

      <Services id="services">
        <Container>
          <SectionTitle>Our Services</SectionTitle>
          <ServiceGrid>
            <ServiceCard
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              viewport={{ once: true }}
            >
              <ServiceIcon>
                <FaRobot />
              </ServiceIcon>
              <ServiceTitle>AI Development</ServiceTitle>
              <ServiceDescription>
                Custom AI solutions powered by cutting-edge machine learning and deep learning technologies.
              </ServiceDescription>
            </ServiceCard>

            <ServiceCard
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
              viewport={{ once: true }}
            >
              <ServiceIcon>
                <FaMobile />
              </ServiceIcon>
              <ServiceTitle>Mobile Apps</ServiceTitle>
              <ServiceDescription>
                Native and cross-platform mobile applications with integrated AI capabilities.
              </ServiceDescription>
            </ServiceCard>

            <ServiceCard
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.4 }}
              viewport={{ once: true }}
            >
              <ServiceIcon>
                <FaCloud />
              </ServiceIcon>
              <ServiceTitle>Cloud Solutions</ServiceTitle>
              <ServiceDescription>
                Scalable cloud infrastructure for AI applications and data processing.
              </ServiceDescription>
            </ServiceCard>
          </ServiceGrid>
        </Container>
      </Services>
    </div>
  );
}

export default App;
